import React from 'react'
import '../style/AboutMe.css';
function AboutMe() {
    return (
      <div className="AboutMe">
        <>
        <h1>Neeyati Mehta</h1>
        <p>I am an inquisitive software developer with a strong passion for Big Data. 
        With a Bachelor's degree in Computer Applications and a Post Graduate Diploma in Data Analysis, my educational path, centered on mathematics and programming logic, has fortified my understanding in computer science. I firmly believe in the transformative power of technology to foster a more equitable world, and my aspiration is to explore innovative and creative approaches in the field. Currently, I am dedicated to sharpening my skills and working diligently to further my ambitions and become a professional Data Scientist.  </p>
        </>
        <p>The decision to join the MSc CDA program at Saint Mary's was influenced by my passion for combining software development with a comprehensive understanding of Big Data. The program's emphasis on software design and data analytics aligns with my career ambitions, offering a platform to expand my skills and carve a path toward a career in Data Science. This program presents an opportunity to bridge my existing knowledge with advanced techniques, nurturing my goal of contributing to technological innovation and becoming a skilled professional in the field of Data Science.</p>
       </div>
    );
  }

  export default AboutMe;
